import "./works.scss";
import {
    featuredPortfolio,
    webPortfolio,
    mobilePortfolio,
    designPortfolio,
    contentPortfolio} from "../../data.js";

export default function Works() {
    return (
        <div className='works' id="works">

            {featuredPortfolio.map( (d) => (<div className="container">
                <div className="itemContainer">
                    <div className="left">
                        {d.title}
                    </div>
                    <div className="right">
                            <img src="d.img"/>
                    </div>
                </div>
            </div>))}

        </div>
    )
}
